const initValue = {
    displayValue : "United States"
}

const selectValueReducer = (state = initValue, action) => {
    switch(action.type){
        case "UNITED_STATES" :
            return {
                ...state,
                displayValue: "United States"
            }
        case "INDIA" :
            return { 
                ...state,
                displayValue: "India"
            }
        case "UNITED_KINGDOM" :
            return {
                ...state,
                displayValue: "United Kingdom"
            }
        default :
            return state;
    }
}

export default selectValueReducer;
